desc:
**WIP**

We are not supporting not meaningful SYSTEM subtypes but we are not dropping them in the CBN: as result we are getting errors related to unsupported event_type.

That's because the produced udm events are like that:

***
timestamp: {
  seconds: 1624255351
}
idm: {
  read_only_udm: {
    metadata: {
      event_timestamp: {
        seconds: 1624255351
      }
      vendor_name: "Palo Alto Networks"
      product_name: "NGFW"
      product_event_type: "SYSTEM - lacp"
    }
    security_result: {
      action: UNKNOWN_ACTION
    }
  }
}
***

We should add a drop statement with TAG_UNSUPPORTED tag

